import React, {useState} from 'react'
import Header from './Header'


type TProps = {
}

const HeaderContainer: React.FC<TProps> = React.memo(() => {

    const [isNavbarOpen, setIsNavbarOpen] = useState<boolean>(false)
    const [isLoginMenuOpen, setIsLoginMenuOpen] = useState<boolean>(true)

    const logoText = 'prompostach'


    return <Header isLoginMenuOpen={isLoginMenuOpen} setIsLoginMenuOpen={setIsLoginMenuOpen} isNavbarOpen={isNavbarOpen} logoText={logoText} setIsNavbarOpen={setIsNavbarOpen} />
})

export default HeaderContainer
